import React, { Component } from 'react'

export default class Cardd extends Component {
    constructor(props){
        super(props);
        this.state={
          Post: [],
        }
        console.log(props);
    }
    componentDidMount(){
        fetch('http://localhost:5000/post/getThread').then( results => {
            return results.json();
        }).then(data => {

            let Post = data.results.map((pos => {
                <div key={data.results}>
                    <div key={pos.idThread}></div>
                    <div key={pos.idUser}></div>
                    <div key={pos.post}></div>
                    <div key={pos.title}></div>
                </div>
            }))
        })
    }
  render() {
    return (
      <div>
        {this.state.Post}
      </div>
    )
  }
}
